import React, { Component } from 'react';

class TaskItem extends Component {
    constructor(props) {
        super(props)
    }
    render() {
        return (
            <tr>
                <td>this.props.task.id</td>
                <td className="text-center">gago3008</td>
                <td className="text-center">123456</td>
                <td className="text-center"><span className="label label-danger">Kich Hoat</span></td>
                <td>
                    <button type="submit" className="btn btn-warning">
                        <span className="fa fa-plus mr-5"></span>Sua
                    </button>&nbsp;
                    <button type="submit" className="btn btn-danger">
                        <span className="fa fa-plus mr-5"></span>Xoa
                    </button>&nbsp;
                </td>
            </tr>

        );
    }

}

export default TaskItem;
